import React from 'react';
import style from './Footer.module.css';
import { Button } from '../Button';

export const Footer = () => {

    return (
        <footer>
            <div className={style.about}>

            </div>
            <div className={style.socialNetwork}>

            </div>
            <Button text='Выбрать питомца' fontSize={20}/>
        </footer>
    )
}
